export default {
  name: 'FormChild',
  props: [
    'message',
    'labelPosition',
    'ruleForm',
    'rules',
    'logo',
    'formInline',
    'showAccount',
    'showMsg',
    'mobile'
    ],
  deta(){
  },
  methods: {
    submitForm(ruleForm) {
      console.log(ruleForm,'submit')
      this.$refs[ruleForm].validate((valid) => {
        console.log(valid,'valid')
        if (valid) {
          // alert('submit!');
          // this.loading = true
          this.$store.dispatch('user/login', this.ruleForm)
            .then(() => {
              this.$router.push({ path: this.redirect || '/', query: this.otherQuery })
              // this.loading = false
            })
            .catch(() => {
              console.log('loading')
              // this.loading = false
            })
        } else {
          console.log('error submit!!');
          return false;
        }
      });
    },
    resetForm(formName) {
      this.$refs[formName].resetFields();
    }
  }
}
